-- Drop tables if they exist (to avoid errors)
DROP TABLE IF EXISTS ApplicationDetail;
DROP TABLE IF EXISTS ApplicantProfile;

-- Create ApplicantProfile table
CREATE TABLE ApplicantProfile (
    applicant_id INT NOT NULL PRIMARY KEY,
    first_name TEXT DEFAULT NULL,
    last_name TEXT DEFAULT NULL,
    date_of_birth TEXT DEFAULT NULL,
    address TEXT DEFAULT NULL,
    phone_number TEXT DEFAULT NULL
);

-- Create ApplicationDetail table
CREATE TABLE ApplicationDetail (
    detail_id INT NOT NULL PRIMARY KEY,
    applicant_id INT NOT NULL,
    application_role VARCHAR(100) DEFAULT NULL,
    cv_path TEXT,
    FOREIGN KEY (applicant_id) REFERENCES ApplicantProfile(applicant_id)
);

